import { Icon } from "@iconify/react";
import {
  AspectRatio,
  Avatar,
  Box,
  Card,
  CardCover,
  Chip,
  IconButton,
  Link,
} from "@mui/joy";
import { Container, Stack, Typography } from "@mui/material";

export default function Portfolio() {
  const portfolioList = [
    {
      image: "./img/portfolio/mun-pilates.jpg",
      companyName: "Mun Pilates",
      link: "https://munpilates.com",
      designedWith: "Wordpress",
      tag: "New",
    },
    {
      image: "./img/portfolio/peoples-coffee.jpg",
      companyName: "Peoples Coffee",
      link: "https://peoplescoffee.shop/",
      designedWith: "PHP",
      tag: "New",
    },
    {
      image: "./img/portfolio/val-holding.jpg",
      companyName: "Val Holding",
      link: "https://oznuryilmaz.com/val-holding/",
      designedWith: "PHP",
      tag: "New",
    },
  ];
  return (
    <Container
      maxWidth="fluid"
      sx={{ backgroundColor: "#0D0D0D", pt: 15, pb: 15 }}
    >
      <Container maxWidth="lg">
        <Stack justifyContent="center" textAlign="center" spacing={1}>
          <Typography variant="body1" fontWeight="bold" color="#c9f31d">
            RECENT WORKS
          </Typography>
          <Typography variant="h4" fontWeight="bold" color="white">
            Completed Works
            <br /> Of Mine
          </Typography>
        </Stack>
        <Stack
          direction="row"
          justifyContent="space-between"
          spacing={3}
          mt={5}
        >
          {portfolioList.map((value) => (
            <Card
              variant="plain"
              sx={{ width: "100%", bgcolor: "initial", p: 0 }}
            >
              <Box sx={{ position: "relative" }}>
                <AspectRatio ratio="4/3">
                  <figure>
                    <img
                      src={value.image}
                      loading="lazy"
                      alt={value.companyName}
                    />
                  </figure>
                </AspectRatio>
                <CardCover
                  className="gradient-cover"
                  sx={{
                    "&:hover, &:focus-within": {
                      opacity: 1,
                    },
                    opacity: 0,
                    transition: "0.1s ease-in",
                    background:
                      "linear-gradient(180deg, transparent 62%, rgba(0,0,0,0.00345888) 63.94%, rgba(0,0,0,0.014204) 65.89%, rgba(0,0,0,0.0326639) 67.83%, rgba(0,0,0,0.0589645) 69.78%, rgba(0,0,0,0.0927099) 71.72%, rgba(0,0,0,0.132754) 73.67%, rgba(0,0,0,0.177076) 75.61%, rgba(0,0,0,0.222924) 77.56%, rgba(0,0,0,0.267246) 79.5%, rgba(0,0,0,0.30729) 81.44%, rgba(0,0,0,0.341035) 83.39%, rgba(0,0,0,0.367336) 85.33%, rgba(0,0,0,0.385796) 87.28%, rgba(0,0,0,0.396541) 89.22%, rgba(0,0,0,0.4) 91.17%)",
                  }}
                >
                  {/* The first box acts as a container that inherits style from the CardCover */}
                  <div>
                    <Box
                      sx={{
                        p: 2,
                        display: "flex",
                        alignItems: "center",
                        gap: 1.5,
                        flexGrow: 1,
                        alignSelf: "flex-end",
                      }}
                    >
                      <Typography level="h2" noWrap sx={{ fontSize: "lg" }}>
                        <Link
                          href="#dribbble-shot"
                          overlay
                          underline="none"
                          sx={{
                            color: "#fff",
                            textOverflow: "ellipsis",
                            overflow: "hidden",
                            display: "block",
                          }}
                        >
                          Go to {value.companyName} Website
                        </Link>
                      </Typography>
                      <IconButton
                        size="sm"
                        variant="solid"
                        color="neutral"
                        target="_blank"
                        href={value.link}
                        sx={{ ml: "auto", bgcolor: "rgba(0 0 0 / 0.2)" }}
                      >
                        <Icon icon="akar-icons:link-out" />
                      </IconButton>
                    </Box>
                  </div>
                </CardCover>
              </Box>
              <Box sx={{ display: "flex", gap: 2, alignItems: "center" }}>
                <Typography
                  sx={{ fontSize: "sm", fontWeight: "md", color: "white" }}
                >
                  Designed By {value.designedWith}
                </Typography>
                <Chip
                  variant="outlined"
                  color="neutral"
                  size="sm"
                  sx={{
                    borderRadius: "sm",
                    py: 0.25,
                    px: 0.5,
                  }}
                >
                  {value.tag}
                </Chip>
                <Link
                  href="#dribbble-shot"
                  level="body-xs"
                  underline="none"
                  startDecorator={<Icon icon="mdi:heart" />}
                  sx={{
                    fontWeight: "md",
                    ml: "auto",
                    color: "white",
                    "&:hover": { color: "danger.plainColor" },
                  }}
                >
                  117
                </Link>
                <Link
                  href="#dribbble-shot"
                  level="body-xs"
                  underline="none"
                  startDecorator={<Icon icon="material-symbols:visibility" />}
                  sx={{
                    fontWeight: "md",
                    color: "white",
                    "&:hover": { color: "primary.plainColor" },
                  }}
                >
                  10.4k
                </Link>
              </Box>
            </Card>
          ))}
        </Stack>
      </Container>
    </Container>
  );
}
